import React from "react";
import { Link } from "react-router-dom";
import './card.css';

export const Card = ({ name , weight , temperament , image , id}) => {
  return (
    <div className="cards">
      <Link to={`/detail/${id}`}>
        <h2>{name}</h2>

        <img src={image} alt='Not found' width='250px' height='300px' className="img"/>
      </Link>
   </div>
  )
};
